// src/components/user/MyBookings.js
import React from 'react';

const UserBookings = ({ bookings = [] }) => {
  // Add default empty array to handle undefined bookings
  // This ensures bookings.length won't cause an error
  
  if (!bookings || bookings.length === 0) {
    return (
      <div className="bg-gray-50 rounded-md p-8 text-center">
        <p className="text-gray-600">You don't have any bookings yet.</p>
        <p className="mt-2 text-gray-500">Book a slot to start charging your EV!</p>
      </div>
    );
  }

  const handleCancelBooking = async (bookingId) => {
    if (window.confirm('Are you sure you want to cancel this booking?')) {
      try {
        const token = localStorage.getItem('token');
        const response = await fetch(`/api/bookings/cancel/${bookingId}`, {
          method: 'PUT',
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          }
        });

        if (response.ok) {
          // Refresh the page or use state management to update the UI
          window.location.reload();
        } else {
          alert('Failed to cancel booking. Please try again.');
        }
      } catch (error) {
        console.error('Error canceling booking:', error);
        alert('An error occurred while trying to cancel your booking.');
      }
    }
  };

  // Function to format date and time for display without date-fns
  const formatDateTime = (dateTimeString) => {
    try {
      const date = new Date(dateTimeString);
      
      // Check if date is valid
      if (isNaN(date.getTime())) {
        return 'Invalid date';
      }
      
      // Format date: Month day, year
      const options = { 
        year: 'numeric', 
        month: 'short', 
        day: 'numeric',
        hour: 'numeric',
        minute: '2-digit',
        hour12: true
      };
      
      return date.toLocaleString('en-US', options);
    } catch (error) {
      console.error('Date formatting error:', error);
      return 'Date error';
    }
  };

  // Safe access to nested properties
  const getBunkName = (booking) => {
    try {
      return booking.bunkId && booking.bunkId.name ? booking.bunkId.name : 'Unknown';
    } catch (error) {
      return 'Unknown';
    }
  };

  return (
    <div className="overflow-x-auto">
      <table className="min-w-full bg-white">
        <thead className="bg-gray-100">
          <tr>
            <th className="py-3 px-4 text-left text-gray-700 font-medium">Bunk</th>
            <th className="py-3 px-4 text-left text-gray-700 font-medium">Start Time</th>
            <th className="py-3 px-4 text-left text-gray-700 font-medium">End Time</th>
            <th className="py-3 px-4 text-left text-gray-700 font-medium">Status</th>
            <th className="py-3 px-4 text-left text-gray-700 font-medium">Actions</th>
          </tr>
        </thead>
        <tbody className="divide-y divide-gray-200">
          {bookings.map((booking, index) => (
            <tr key={booking._id || index} className="hover:bg-gray-50">
              <td className="py-3 px-4">{getBunkName(booking)}</td>
              <td className="py-3 px-4">{formatDateTime(booking.startTime)}</td>
              <td className="py-3 px-4">{formatDateTime(booking.endTime)}</td>
              <td className="py-3 px-4">
                <span className={`inline-block px-2 py-1 text-xs font-semibold rounded-full ${
                  booking.status === 'active' 
                    ? 'bg-green-100 text-green-800' 
                    : booking.status === 'cancelled' 
                    ? 'bg-red-100 text-red-800' 
                    : booking.status === 'completed'
                    ? 'bg-blue-100 text-blue-800'
                    : 'bg-yellow-100 text-yellow-800'
                }`}>
                  {booking.status ? (booking.status.charAt(0).toUpperCase() + booking.status.slice(1)) : 'Unknown'}
                </span>
              </td>
              <td className="py-3 px-4">
                {booking.status === 'active' && (
                  <div className="space-x-2">
                    <button
                      onClick={() => handleCancelBooking(booking._id)}
                      className="bg-red-100 hover:bg-red-200 text-red-700 py-1 px-3 rounded-md text-sm transition-colors"
                    >
                      Cancel
                    </button>
                    <a
                      href={`/reschedule/${booking._id}`}
                      className="bg-blue-100 hover:bg-blue-200 text-blue-700 py-1 px-3 rounded-md text-sm transition-colors"
                    >
                      Reschedule
                    </a>
                  </div>
                )}
                {booking.status === 'cancelled' && (
                  <span className="text-gray-500 text-sm">Cancelled</span>
                )}
                {booking.status === 'completed' && (
                  <span className="text-gray-500 text-sm">Completed</span>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserBookings;
